import React from "react";
import { Todo } from "../../utils/types";
import { Container, RowContainer, Title, GoogleButton } from "../../ui-kit";

interface TodoListProps {
  todos: [Todo];
  updateTodo: any;
  deleteTodo: any;
}

export const TodoList: React.FC<TodoListProps> = ({
  todos,
  updateTodo,
  deleteTodo,
}) => {
  return (
    <>
      {todos.map((todo) => (
        <Container>
          <RowContainer>
            <Title>{todo.name}</Title>
            <GoogleButton color="RED" onClick={() => deleteTodo(id)}>
              Reject
            </GoogleButton>
          </RowContainer>
        </Container>
      ))}
    </>
  );
};
